import React, { useState } from "react";
const CoachFilter = () => {
  const [selectedGoals, setSelectedGoals] = useState("");
  const [selectedExperience, setSelectedExperience] = useState("");
  const [selectedLoa, setSelectedGoal] = useState("");
  const [selectedMuscle, setSelectedMuscle] = useState("");

  const handleApplyClick = () => {
    console.log("Selected Equipment:", selectedGoals);
    console.log("Selected Difficulty:", selectedExperience);
    console.log("Selected Goal:", selectedGoal);
    console.log("Selected Muscle:", selectedMuscle);
  };

  return (
    <div>
      <div id="filterby">Filter by:</div>
      <label>
        Goal:{" "}
        <select
          value={selectedGoals}
          onChange={(e) => setSelectedGoals(e.target.value)}
        >
          <option value=""></option>
          <option value="No-Equipment">No Equipment</option>
          <option value="Pull-up Bar">Pull-up Bar</option>
          <option value="Dumbbells">Dumbbell</option>
        </select>
      </label>

      <label>
        Experience:{" "}
        <select
          value={selectedExperience}
          onChange={(e) => setSelectedExperience(e.target.value)}
        >
          <option value=""></option>
          <option value="beginner">Beginner</option>
          <option value="intermediate">Intermediate</option>
          <option value="advanced">Advanced</option>
        </select>
      </label>

      <label>
        Location:{" "}
        <select
          value={selectedGoal}
          onChange={(e) => setSelectedGoal(e.target.value)}
        >
          <option value=""></option>
          <option value="weight-loss">Weight Loss</option>
          <option value="muscle-gain">Muscle Gain</option>
        </select>
      </label>

      <label>
        Cost:{" "}
        <select
          value={selectedMuscle}
          onChange={(e) => setSelectedMuscle(e.target.value)}
        >
          <option value=""></option>
          <option value="Chest">Chest</option>
          <option value="Back">Back</option>
          <option value="Abs">Abs</option>
          <option value="Arms">Arms</option>
          <option value="Legs">Legs</option>
        </select>
      </label>
      <div>
        <button id="apply-btn" onClick={handleApplyClick}>
          apply
        </button>
      </div>
    </div>
  );
};

export default CoachFilter;
